<!DOCTYPE html>
<head>
  <meta charset="utf-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <title>CollegeVibe</title>
  <meta name="description" content="CollegeVibe is your one-stop guide to the college town. Whether you're looking for information on the college or the town itself, we've got you covered!">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <link rel="favicon" href="assets/images/collegevibe-logo-white.png">
  <link rel="stylesheet" href="http://maxcdn.bootstrapcdn.com/font-awesome/4.3.0/css/font-awesome.min.css">
  <link rel="stylesheet" type='text/css' href="styles/main.css">

<body>


  <div id="application"></div>

  <script type="text/template" id='login-view'>
    <% if (!Parse.User.current()) { %>
      <div class="login-container">
        <label>Email Address</label>
        <input placeholder="Enter your email" type='text'>
        <label>Password</label>
        <input placeholder="Enter your password" type='password'>
        <button>Log In</button>
        <p class="register-btn">Register an account?</p>
      </div>

      <div class="register-container">
        <label>Full Name</label>
        <input placeholder="Enter your full name" type='text'>
        <label>Email Address</label>
        <input placeholder="Enter your email" type='text'>
        <label>Enter password</label>
        <input placeholder="Password" type='password'>
        <label>Confirm your password</label>
        <input placeholder="Confirm Password" type='password'>
        <button>Sign Up</button>
        <p class="login-btn">Go back to login</p>
      </div>
    <% } else { %>
      <h1 style='font-size:20px'><%= Parse.User.current().get('name') %></h1>
    <% } %>
  </script>

  <script type='text/template' id='food-template'>
    <li>
      <span class="fa fa-angle-right"></span>
      <div class="hotel-name">
        <h1><%=name%></h1>
        <p><%=address%></p>
        <p><%=locality%>, <%=region%> <%=postcode%></p>
      </div>
      <div class="hotel-radius">
        <p><%=(($distance/1000) * 0.621371).toFixed(1)%> mi.</p>
        <% if(typeof tel !== 'undefined') { %>
          <p><%= tel %></p>
        <% } %>
        <% if(typeof website !== 'undefined') { %>
          <a target="_blank" href=<%= website %> ><p><%= website.split(/http[s]?:\/\/[www.]{0,4}/)[1].split('/')[0] %></p></a>
        <% } %>
      </div>
    </li>
  </script>
